import{_ as e,a,b as r,c as t,d as o}from"./chunks/rtk_fem_fb_2.j1iLjbtY.js";import{_ as i,c as l,o as s,ab as m}from"./chunks/framework.CUflZczI.js";const b=JSON.parse('{"title":"Femtones MINI2 приймач","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/rtk_gps_fem_mini2.md","filePath":"uk/gps_compass/rtk_gps_fem_mini2.md"}'),n={name:"uk/gps_compass/rtk_gps_fem_mini2.md"},_=m('<h1 id="femtones-mini2-приимач" tabindex="-1">Femtones MINI2 приймач <a class="header-anchor" href="#femtones-mini2-приимач" aria-label="Permalink to &quot;Femtones MINI2 приймач&quot;">​</a></h1><p><a href="http://www.femtomes.com/#/MiniII?type=0" target="_blank" rel="noreferrer">MINI2 Receiver</a> - це RTK GPS-отримувач, який забезпечує високу швидкість і надійну ініціалізацію RTK для позиціонування на рівні сантиметрів. Він призначений для застосувань, які вимагають високоточного позиціонування (наприклад, навігація та картографування тощо).</p><p>Приймач підключений до PX4 через послідовний порт (UART) і може бути налаштований через Ethernet за допомогою стандартного веб-браузера.</p><p><img src="'+e+'" alt="Приймач MINI II"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Драйвери PX4 для Ethernet, CAN та USB знаходяться в стадії розробки.</p></div><h2 id="необхідні-параметри-прошивки" tabindex="-1">Необхідні параметри прошивки <a class="header-anchor" href="#необхідні-параметри-прошивки" aria-label="Permalink to &quot;Необхідні параметри прошивки&quot;">​</a></h2><p>При купівлі пристрою необхідно вибрати наступні параметри вбудованого програмного забезпечення:</p><ul><li>5Гц, 10Гц, 20Гц</li><li>INS</li><li>ЗАГОЛОВОК</li><li>OBS</li><li>RTK</li><li>BASE</li></ul><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><p>Звертайтеся безпосередньо до <a href="http://www.femtomes.com/" target="_blank" rel="noreferrer">Femtones</a> для отримання комерційної пропозиції:</p><ul><li><strong>Email:</strong> <a href="mailto:sales@femtomes.com" target="_blank" rel="noreferrer">sales@femtomes.com</a></li><li><strong>Телефон:</strong> +86-10-53779838</li></ul><h2 id="функціональні-порти" tabindex="-1">Функціональні Порти <a class="header-anchor" href="#функціональні-порти" aria-label="Permalink to &quot;Функціональні Порти&quot;">​</a></h2><p><img src="'+a+'" alt="MINI II 1"></p><h2 id="підключення-та-з-єднання" tabindex="-1">Підключення та з&#39;єднання <a class="header-anchor" href="#підключення-та-з-єднання" aria-label="Permalink to &quot;Підключення та з&#39;єднання&quot;">​</a></h2><p><a href="http://www.femtomes.com" target="_blank" rel="noreferrer">Приймач MINI2</a> підключений до UART на контролері польоту (порт GPS) для передачі даних. Для живлення модуля вам знадобиться окреме джерело живлення 12В. Контакти на 12-контактному роз&#39;ємі позначені, як показано нижче.</p><p><img src="'+r+'" alt="MINI_II_2"></p><h2 id="конфігурація" tabindex="-1">Конфігурація <a class="header-anchor" href="#конфігурація" aria-label="Permalink to &quot;Конфігурація&quot;">​</a></h2><p>Для оцінювання заголовку потрібно, щоб дві антени були на одному рівні і були відстані щонайменше 30 см одна від одної. Напрям, у якому вони обертаються, не має значення, оскільки його можна налаштувати за допомогою параметра <a href="./../advanced_config/parameter_reference.html#GPS_YAW_OFFSET">GPS_YAW_OFFSET</a>.</p><p>Налаштуйте послідовний порт, на якому буде працювати <a href="http://www.femtomes.com/#/MiniII?type=0" target="_blank" rel="noreferrer">Приймач MINI2</a>, використовуючи <a href="./../advanced_config/parameter_reference.html#GPS_1_CONFIG">GPS_1_CONFIG</a>, і встановіть швидкість передачі даних на 115200 за допомогою <a href="./../advanced_config/parameter_reference.html#SER_GPS1_BAUD">SER_GPS1_BAUD</a>.</p><p>Після налаштування приймач використовується так само, як будь-який інший <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> (тобто щодо процесу вивчення території).</p><h2 id="додаткова-інформація" tabindex="-1">Додаткова інформація <a class="header-anchor" href="#додаткова-інформація" aria-label="Permalink to &quot;Додаткова інформація&quot;">​</a></h2><p>MINI2 включає наступні компоненти:</p><ul><li><p><a href="http://www.femtomes.com/#/FB672" target="_blank" rel="noreferrer">FB672</a>: Компактна, подвійної антени, подвійної частоти платформа GNSS OEM (надає позицію з точністю в сантиметрах та точний курс).</p><p><img src="'+t+'" alt="FB672"></p></li><li><p><a href="http://www.femtomes.com/#/FB6A0" target="_blank" rel="noreferrer">FB6A0</a>: Компактна чотириразова апаратура GNSS OEM (забезпечує сантиметрову точність позиціювання)</p><p><img src="'+o+'" alt="FB6A0"></p></li></ul><p>Докладні інструкції щодо продукту можна отримати на офіційному веб-сайті або зв&#39;язавшись з нами.</p>',24),p=[_];function c(h,f,d,I,u,g){return s(),l("div",null,p)}const P=i(n,[["render",c]]);export{b as __pageData,P as default};
